        function getRegionColor(regionName) {
            var colors = {"Caribe": "#FF9999", "Andina": "#FFCC00", "Pac\u00edfica": "#66B2FF", "Orinoqu\u00eda y Amazon\u00eda": "#66B266", "Antioquia": "#FF66B2"};
            return colors[regionName];
        }

        function onEachFeature(feature, layer) {
            layer.on('click', function() {
                var popupContent = createPopupContent(feature.properties);
                var popup = L.popup()
                    .setLatLng(map.getCenter())
                    .setContent(popupContent)
                    .openOn(map);

                // Crear gráficos después de que el popup esté visible
                var estratosData = {
                    labels: Object.keys(feature.properties.Estratos),
                    datasets: [{
                        data: Object.values(feature.properties.Estratos).map(range => (range[0] + range[1]) / 2),
                        backgroundColor: Object.values(estratosColors)
                    }]
                };
                var clientesData = {
                    labels: Object.keys(feature.properties['Clientes por categoría']),
                    datasets: [{
                        data: Object.values(feature.properties['Clientes por categoría']).map(range => Array.isArray(range) ? (range[0] + range[1]) / 2 : range),
                        backgroundColor: Object.values(clientesColors)
                    }]
                };
                new Chart(document.getElementById('estratosChart'), {
                    type: 'pie',
                    data: estratosData,
                    options: {
                        title: {
                            display: true,
                            text: 'Distribución de Estratos'
                        }
                    }
                });
                new Chart(document.getElementById('clientesChart'), {
                    type: 'pie',
                    data: clientesData,
                    options: {
                        title: {
                            display: true,
                            text: 'Clientes por Categoría'
                        }
                    }
                });
            });
        }

        L.geoJSON(regionesData, {
            style: function(feature) {
                return {
                    color: "#000",         // Color de las fronteras
                    weight: 2,             // Grosor de las fronteras
                    fillColor: getRegionColor(feature.properties.name),
                    fillOpacity: 0.5
                };
            },
            onEachFeature: onEachFeature
        }).addTo(map);

    </script>
